import matplotlib.pyplot as plt
import numpy as np
from gtts import gTTS
import IPython.display as ipd
import tempfile

print("운동 법칙을 선택해주세요.")
print("1: 자유낙하운동, 2: 운량 보존 법칙, 3: 등가속도 운동, 4: 등속 원운동")
